// Login.js

import React from "react";
import "./Login.css"; // Importing the CSS file

const ClearOutput = () => {
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (!(Email === "") || !(Password === "")) {
        Email.value = "";
        Password.value = "";
    }
};

const LoginBtn = () => {};

const Login = () => {
    return (
        <div className="login-container">
            <main className="login-form-container">
                <form className="login-form">
                    <h1 className="login-heading">Student Log In</h1>
                    <div className="input-group">
                        <label className="input-label" htmlFor="email-address">Email</label>
                        <input className="input-field" type="email" name="email-address" id="email-address" />
                    </div>
                    <div className="input-group">
                        <label className="input-label" htmlFor="password">Password</label>
                        <input className="input-field" type="password" name="password" id="password" />
                        <a href="#0" className="forgot-password">Forgot your password?</a>
                    </div>
                    <div className="button-group">
                        <input className="login-button" type="submit" value="Log In" onClick={LoginBtn} />
                        <input className="clear-button" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                </form>
            </main>
            <footer className="footer">
                <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
            </footer>
        </div>
    );
}

export default Login;
